    // Function untuk melakukan dekripsi AES-256-CBC
    private function decryptData($key, $string)
    {
        // Menghasilkan hash dari key
        $key_hash = hex2bin(hash('sha256', $key));

        // Mengambil IV dari key
        $iv = substr(hex2bin(hash('sha256', $key)), 0, 16);

        // Melakukan dekripsi dengan OpenSSL
        $output = openssl_decrypt(base64_decode($string), 'AES-256-CBC', $key_hash, OPENSSL_RAW_DATA, $iv);

        return $output;
    }

    // Function untuk melakukan dekompresi dengan LZ-string
    private function decompressData($string)
    {
        return LZString::decompressFromEncodedURIComponent($string);
    }
